import React from 'react';

function DateCarousel() {
  // Example of using hooks for state
  return (
    <div className="date-carousel-container">
    <button className="scroll-btn left-scroll" onclick="scrollCLeft()">«</button>
    <div className="date-carousel">
        <div className="date-box">Mon</div>
        <div className="date-box">Tue</div>
        <div className="date-box">Wed</div>
        <div className="date-box selected">Thu</div>
        <div className="date-box">Fri</div>
        <div className="date-box">Sat</div>
        <div className="date-box">Mon</div>
        <div className="date-box">Tue</div>
        <div className="date-box">Wed</div>
        <div className="date-box">Thu</div>
        <div className="date-box">Fri</div>
        <div className="date-box">Sat</div>
    </div>
    <button class="scroll-btn right-scroll" onclick="scrollCRight()">»</button>
</div>
  );
}




export default DateCarousel;
